import React, { useState, useEffect } from 'react';
import { useSearch } from '../SearchContext';
import './wazuh.css';

function convert(date) {
  const newDate = new Date(date);
  const newDate2 = new Date(date);
  const options = {
    day: 'numeric',
    month: 'numeric',
    year: 'numeric',
  };

  const options2 = {
    hour: 'numeric',
    minute: 'numeric',
    hour12: true,
  };

  const array = [
    newDate.toLocaleDateString(undefined, options),
    newDate2.toLocaleTimeString(undefined, options2),
  ];
  console.log(array);
  return array;
}

const WazuhCombined = () => {
  const { searchQuery } = useSearch();
  const [data, setData] = useState({
    active: {
      total_count: 0,
      affected_items: [],
    },
    inactive: {
      total_count: 0,
      affected_items: [],
    },
    disconnected: {
      total_count: 0,
      affected_items: [],
    },
  });

  useEffect(() => {
    fetchData('get-active_count', 'active');
    fetchData('get-inactive_count', 'inactive');
    fetchData('get-disconnected_count', 'disconnected');
  }, [searchQuery]); // Update data when searchQuery changes

  const fetchData = async (endpoint, key) => {
    try {
      const response = await fetch(`http://localhost:3001/${endpoint}`);
      const responseData = await response.json();
      setData((prevData) => ({
        ...prevData,
        [key]: responseData.data,
      }));
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <>
      <table className='table'>
        <thead>
          <tr>
            <th>S.No</th>
            <th>OS</th>
            <th>Agent Name</th>
            <th>IP</th>
            <th className=''>Date</th>
            <th className=''>Time</th>
            <th className=''>Status</th>
          </tr>
        </thead>
        <tbody>
          {data.active.affected_items.map((item, index) => (
            <tr key={index}>
                <td>{index}</td>
              <td>{item.os_name}</td>
              <td>{item.agent_name}</td>
              <td>{item.registerIP}</td>
              <td className=''>{convert(item.dateAdd)[0]}</td>
              <td className=''>{convert(item.dateAdd)[1]}</td>
              <td className=''>Active</td>
            </tr>
          ))}
          {data.inactive.affected_items.map((item, index) => (
            <tr key={index}>
                <td>{index+1}</td>
              <td>{item.os_name}</td>
              <td>{item.agent_name}</td>
              <td>{item.registerIP}</td>
              <td className=''>{convert(item.dateAdd)[0]}</td>
              <td className=''>{convert(item.dateAdd)[1]}</td>
              <td className=''>Inactive</td>
            </tr>
          ))}
          {data.disconnected.affected_items.map((item, index) => (
            <tr key={index}>
                <td>{}</td>
              <td>Unknown</td>
              <td>{item.agent_name}</td>
              <td>{item.registerIP}</td>
              <td className=''>{convert(item.dateAdd)[0]}</td>
              <td className=''>{convert(item.dateAdd)[1]}</td>
              <td className=''>Disconnected</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

export default WazuhCombined;
